import React from 'react'

const list = [
    {
      id: 'a',
      firstname: 'Robin',
      url: 'https://static.toiimg.com/photo/msid-67586673/67586673.jpg?resizemode=4&width=400',
    },
    {
      id: 'b',
      firstname: 'Dave',
      lastname: 'Davidds',
      url: 'https://www.loveyourdog.com/wp-content/uploads/2019/05/Best-Crates-For-Golden-Retrievers-900x500.jpg',
    },
  ];

const Adoption = () => {
    return(
        <div className="container">
            <h4 className="left">Adoption</h4>
            <br></br>
            <br></br>
            <br></br>
            <ul>
                {list.map(item => (
                <li key={item.id}>
                    <div>{item.firstname}</div>
                    <div><img width="100%" height="400px" src={list.url}/></div>
                </li>
                ))}
            </ul>
        </div>
    )
}

export default Adoption;
